# Basics:
# n = p * q (p & q are random prime numbers)
# n is public (prime factorization problem)
# to generate the private key d we need n,e (known) and p,q (not known)
# if we factorize n -> p * q everything breaks

# if we know one of the prime numbers (p,q) we know the other one (n/p=q)
# if one of the primes is used twice in the keys (p*a = public key and p*b = another public key) we can use GCD
# Why?
# if two public keys have one random prime number in common then this prime number is the common divisor
# a * q = public key
# b * q = another public key
# if both q are equal then euclids algorithm finds q

