# loop over public keys
for public_key in rsa_keys:
    gcd = math.gcd(target_public_key, rsa_keys[public_key])
    if (gcd != 1) :
        print("GCD for\n{}\nand\n{}:\n\n=> {}\n".format(target_public_key, rsa_keys[public_key], gcd))
        p = gcd
        q = target_public_key // p
        break

n = target_public_key
# verify
if (n == p * q) :
    print("n: {}\n".format(n))
    print("p: {}\n".format(p))
    print("q: {}\n".format(q))

# now we have n,p,q,e
# d is the modulo multiplicative inverse of e modulo phi(n)
phi = (p-1)*(q-1)
print("phi: {}\n".format(phi))
d = pow(e, -1, phi)
print("d: {}\n".format(d))
plain = pow(c, d, target_public_key)
print("plain: {}\n".format(plain))

